      Hint: SubText
      Value: "Etofenprox is a very effective, low toxicity pyrethroid that acts on the nervous system of insects by disrupting their neuron sodium channels. Etofenprox is a contact-kill adulticide used to control a wide variety of insects including weevils, beetles, aphids, moths, whiteflies, thrips, borers, fleas and mosquitoes. Etofenprox is well tolerated by mammals, including cats, and is environmentally friendly."
